export default () => (
  <header>
    <nav>
      <h1>Killerpedia</h1>
      <div className="menu">
        <span>Browse by:</span>
      </div>
      <style jsx>{`
        nav {
          max-width: 1400px;
          margin: 0 auto;
          display: flex;
          align-items: center;
        }

        h1 {
          font-size: 2rem;
          margin: 4px 0;
        }
      `}</style>
    </nav>
  </header>
);
